MongoDB - Push to nested array with findOneAndUpdate<p>I would like to know whether it is possible to implement the following problem within a single call of <code>findOneAndUpdate()</code> method.
Let's consider this collection entry:</p>
<pre><code>[
  {
    &quot;key&quot;: 1,
    &quot;logs&quot;: [
      {
        &quot;app_logs&quot;: [
          {
            &quot;stdout&quot;: &quot;app_stdout_1&quot;,
            &quot;stderr&quot;: &quot;app_stderr_1&quot;
          }
        ],
        &quot;syslog&quot;: &quot;syslog_val1&quot;
      },
      {
        &quot;app_logs&quot;: [
          {
            &quot;stdout&quot;: &quot;app_stdout_2&quot;,
            &quot;stderr&quot;: &quot;app_stderr_2&quot;
          }
        ],
        &quot;syslog&quot;: &quot;syslog_val2&quot;
      }
    ]
  },
]
</code></pre>
<p>I need to push an additional element into <code>app_logs</code> array but only within the last entry of <code>logs</code> array. Currently to bypass this issue, I fetch the document as it is, execute such push in the application and then use <code>findOneAndReplace()</code> method. While this works I would like it to be implemented within a single MongoDB call. I have tried various approaches like pipeline aggregations, update array filters etc. but could not get any of them to work. Also tried to find the solution online, and read the docs but still can't find any similar problem that was successfully solved.</p>
<p>The most common similar problem people tend to hit is updating specific element in a nested array under conditions that can be solved by using a positional operator with something like:</p>
<pre><code>findOneAndUpdate({
  &quot;key&quot;: 1,
  &quot;logs.syslog&quot;: &quot;syslog_val1&quot;
},
{
  &quot;$push&quot;: {
    &quot;logs.$.app_logs&quot;: {
      &quot;stdout&quot;: &quot;app_stdout_new&quot;,
      &quot;stderr&quot;: &quot;app_stderr_new&quot;
    }
  }
})
</code></pre>
<p>In my case, I want to execute such push not for the specific element of the <code>logs</code> array but only for the last one. Since I already spent a lot of time with this problem it leads me to the question of whether it is even possible to implement or whether there are any limitations with the current MongoDB version which would make such implementation impossible.
Thanks for any help.</p>

